import { EMPTY_PROCESS } from '../../utils/constants';

export const getProcess = store => store.processReducer.process || EMPTY_PROCESS;
export const getDetailsProcess = store => store.processReducer.detailsProcess.process || {};
export const getHasDetailsProcess = store => store.processReducer.hasDetailsProcess.flag;
export const loadProcessesFromStore = store => store.processReducer.processList;

// * SELECTOR PRA NOVA LISTING VIEW
export const getDetailingEntry = store => store.processReducer.detailsProcess.process || {};
export const getShowDetailingEntry = store => store.processReducer.showDetailingEntry;
export const getListingData = store => store.processReducer.processList;
